import React, {useEffect,useState, useContext} from 'react';
import axios from 'axios';
import { Server } from '../index';
import '../css/database.css';
import labels from '../labels.json' ;

export default function Database(){

    const [startDate,setStartDate] = useState(null)
    const [endDate,setEndDate] = useState(null)

    const [minLength,setMinLength] = useState(null)
    const [maxLength,setMaxLength] = useState(null)

    const [language,setLanguage] = useState(null)
    const [correction,setCorrection] = useState(null)
    const [comment,setComment] = useState(null)
    const [words,setWords] = useState(null)

    const [data,setData] = useState([])
    const server = useContext(Server)

    useEffect(()=>{
        const fetchData = async ()=>{
            try {
                const response = await axios.get(server+'database')
                setData(response.data)
                console.log(response.data)
            }
            catch(error){

            }
        };
        fetchData()
    },[])

    return(
        <div>
            <div className='search-bar'>

                <div className='filter-option'>
                    <input type='checkbox' id='date'></input><b>Date: </b>
                    <div className='filter-inputs'>
                        <span>from:</span>
                        <input type='date' id="from-date" value={startDate?startDate:null} onChange={()=>{setStartDate(e.target.value)}}></input>
                        <br/>
                        <span>to:</span><input type='date' id="to-date"></input>

                    </div>
                </div>

                <div className='filter-option'>
                    <input type='checkbox' id='date'></input><b>Length: </b>
                    <div className='filter-inputs'>
                        <span>from:</span><input type='number' id="min-length" style={{width: '6vw'}} min={1}></input>
                        <br/>
                        <span>to:</span><input type='number' id="max-length" style={{width: '6vw'}} min={1}></input>

                    </div>
                </div>

                <div className='filter-option'>
                    <input type='checkbox' id='date'></input><b>Language: </b>
                    <div className='filter-inputs'>
                        <br/>
                        <select id="select-language">
                            {labels.language.map((x)=>
                                <option key={x} value={x}>
                                    {x}
                                </option>
                    )}
                        </select>

                    </div>
                </div>

                <div className='filter-option'>
                    <input type='checkbox' id='date'></input><b>Correction: </b>
                    <div className='filter-inputs'>

                        <span>has correnction</span> <input type='radio' id="correction-provided" name="correction" ></input>   
                        <br/>
                        <span>no correnction</span> <input type='radio' id="correction-not-provided" name="correction"></input>  


                    </div>
                </div>

                <div className='filter-option'>
                    <input type='checkbox' id='date'></input><b>Comment: </b>
                    <div className='filter-inputs'>
                        <span>has comment</span> <input type='radio' id="comment-provided" name="comment" ></input>   
                        <br/>
                        <span>no comment</span> <input type='radio' id="comment-not-provided" name="comment"></input>  


                    </div>
                </div>

                <div className='filter-option'>
                    <input type='checkbox' id='date'></input><b>Key Words: </b>
                    <div className='filter-inputs'>
                        <br/>
                        <input type='text' style={{ maxWidth:'12vw'}}/>

                    </div>
                </div>

                <button className='search-button'>Search</button>           


                <div className='clearfix'></div>
             </div>
             <div className='content'>

                <div className='clearfix'></div>
             </div>
        </div>
    )
}
